import React from "react";

export default function SunriseSunset() {
  return (
    <div className="sunrise-sunset">
      <div className="row">
        <div className="col-6">
          <img id="sunrise-image" src="images/SUNRISE.png" alt="" />
        </div>
      </div>
    </div>
  );
}
